import * as React from 'react';
import { BrowserRouter as Router, Route, Switch , Redirect} from 'react-router-dom';
import welcomePage from './pages/welcomePage'
import LoginPage from './pages/loginPage'
import GoogleMapAPI from './utils/googleMapAPI'
import Chat from './pages/chat'
import Chat2 from './pages/chat2'
import Chats from './pages/chats'
import InputInfo from './pages/inputInfo'
import TopPage from './pages/topPage'
import Tutorial from './pages/turotial'
import ContactForm from './pages/contactForm'
import PasswordForgot from './pages/passwordForgot'
import PasswordReset from './pages/passwordReset'
import './App.css'

const Auth: React.FC = (props: any) => {
  const jwt = localStorage.getItem('jwt')
  console.log(props.children)
  // const { loginInfo: { jwt } } = useLoginInfo();
  // if (!props.location.pathname.includes("app/")) return
  return (jwt? props.children: <Redirect to={'/login'}/>)
};

const App: React.FC = () => {
  return (
    <div style={{backgroundColor:'#eeedea'}}>
      <Router>
        <Switch>
          <Route path="/" component={welcomePage} exact/>
          <Route path="/login" component={LoginPage} exact/>
          <Route path="/map" component={GoogleMapAPI} exact/>
          <Route path="/chat" component={Chat} exact/>
          <Route path="/inputinfo" component={InputInfo} exact/>
          <Route path="/topPage" component={TopPage} exact/>
          <Route path="/tutorial" component={Tutorial} exact/>
          <Route path="/contact" component={ContactForm} exact/>
          <Route path="/passwordForgot" component={PasswordForgot} exact/>
          <Route path="/passwordReset" component={PasswordReset} exact/>
          <Route path="/chats" component={Chats} exact/>
          <Route path="/chat2" component={Chat2} exact/>
        </Switch>
      </Router>
    </div>
  );
};

export default App;
